export default function ContactList( { items } ){

    const fetchedItems = items.map((item) => {
        let anchorPrefix = '';
        if((item.label.toUpperCase()) === "Phone"){
            anchorPrefix = `tel:${item.value}`;
        }
        else if(item.label === "email"){
            anchorPrefix = `mailto:${item.value}`;
        }
        else if(item.label === "address"){
            anchorPrefix = "javascript:void(0);";
        }
        return (
            <div key={item.label}>
                <label>{item.label}</label>
                <a href={anchorPrefix}>{item.value}</a>
            </div>
        )
    });

    return (
        <div className="contact__list">
            {fetchedItems}
        </div>
    )
}
